    //     _id: props._id,
    //     aorr: "a",
    // })
    // .then(function (response) {
    //     console.log(response);
    // })
    // .catch(function (error) {
    //     console.log(error);
    // });
  };

  const handlecancel = (props) => {
    // axios.post('http://localhost:4000/vendor/updateorderstatus', {
    //     _id: props._id,
    //     aorr: "r",
    // })
