    //     console.log(response);
    // })
    // .catch(function (error) {
    //     console.log(error);
    // });
  };

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>ItemName</TableCell>
            <TableCell align="center">PlacedTime</TableCell>
            <TableCell align="center">Quantity</TableCell>
            <TableCell align="center">BuyerName</TableCell>
            <TableCell align="center">AddOns</TableCell>
            <TableCell align="center">Total</TableCell>
            <TableCell align="center">Status</TableCell>
            <TableCell align="center">Action</TableCell>
            <TableCell align="center">Rating</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {orders.map((orders) => (
            <TableRow
              key={orders._id}
              sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {orders.itemname}
              </TableCell>
              {/* Convert number to unix time */}
              <TableCell align="center">
                {new Date(orders.placedtime).toLocaleString()}
              </TableCell>
              <TableCell align="center">{orders.quantity}</TableCell>
              <TableCell align="center">{orders.buyername}</TableCell>
              <TableCell align="center">{orders.addonname}</TableCell>
              <TableCell align="center">Rs.{orders.totalprice}</TableCell>
              <TableCell align="center">{orders.status}</TableCell>

              {orders.status !== "READY FOR PICKUP" ? (
                <TableCell align="center">
                  <Button variant="contained" color="primary" disabled>
                    Pick Up
                  </Button>
                </TableCell>
              ) : (
                <TableCell align="center">
                  <Button
                    variant="contained"
                    color="primary"
                    onClick={() => handlenextstage(orders)}
                  >
                    Pick Up
                  </Button>
                </TableCell>
              )}
              {orders.status === "COMPLETED" ? (
                <TableCell align="center">
                  <Rating
                    name="simple-controlled"
                    value={value}
                    onChange={(event, newValue) => {
                      setValue(newValue);
                    }}
                  />
                </TableCell>
              ) : (
                <TableCell align="center">
                  <Rating name="disabled" value={0} disabled />
                </TableCell>
              )}
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
